  return (
    <>
      <header cl>
        <div className="container">
          <div className="row">
            <div className="col-4">
              <Logo />
            </div>

            <div className="col-4">
              <Title />
            </div>

            <div className="col-4">
              <Search />
            </div>
          </div>
        </div>
      </header>
    </>
  );
}

export default Header;
